bite size reviews: current 🚿 shelfie 👇🏻 

@bumbleandbumble sunday shampoo: love using this on wash days (2x a week) to really clarify and deep clean my hair and roots. doesn’t overdry my hair and lathers really nice! plus is smells 👌🏻 
@vegamour hydr8 hair mask: not a fan of this one. it is super thick and v hard to wash out, leaving my hair feeling greasy after using this. it also smells like baby powder which i’m not crazy for. a pass for me.
@oribe hair alchemy shampoo: love this line! smells amazing and makes my hair feel so soft and healthy when using it! pricey but Oribe is always worth it IMO
@peachandlily ginger melt oil cleanser: been using this to cleanse my skin when i wear makeup and it’s v nice. removes all traces of makeup and leaves my skin feeling soft and clean! 
@freshbeauty soy cleanser: a forever holy grail cleanser. smells like a spa (🥒) and is so gentle yet effective on the skin! 
@traderjoes Brazilian nut body wash: the hype is real. an absolute dupe for the sol de janiero bum bum — it smells identical and no reason to pay for the name brand lol. this was only $6 i think and i am obsessed. the perfect summer body wash! 

