☀️🧴summer staples 🥥🍌

@babybum @sunbum foam shampoo + wash: this smells HEAVENLY. a super subtle coconut scent, we (lucia & i, obvs) have been loving this for baths this summer! it lathers so nicely and is super gentle on her skin leaving it baby soft (literally). love the pump so its easy to apply to a washcloth and the plant-based ingredients are *chefs kiss*

@vacationinc classic lotion spf 30: my go-to body spf! it smells like coppertone and brings me back to my childhood but love mostly that it soaks into the skin so easily and never leaves an annoying white cast! wish they sold a jumbo size cause i go through these tubes so fast! *hint hint* to the brand! 😉 

@briogeo banana + coconut soft wave texture spray: if you're in the market for a new leave in spray, this is it. first and foremost, it smells like a tropical drink but the way it leaves my hair so soft and frizz-free, i can't stop reaching for it! highly recommend!

@soldejaneiro bum bum cream: this scent is just a staple for me in the summertime (don’t really wear it any other time of the year)! the hype is real however i prob will buy the Trader Joe’s version of this body cream when i’m done with it cause it’s literally the same thing and a quarter of the price 🙂

@poppyandpout banana cream lip balm: clearly i like banana scented things in the summer 😂 this one smells so good but feels even better on the lips — love the recyclable cardboard packaging too! 👏🏻 

